$BookSysUtil={};$BookSysUtil.Date={};$BookSysUtil.Date.convertStringsToDates=function(input){var regexIso8601=/(\d{4})-([01]\d)-([0-3]\d)T([0-2]\d):([0-5]\d):([0-5]\d)$/;if(typeof input!=="object")return input;for(var key in input){if(!input.hasOwnProperty(key)){continue}var that=this,value=input[key];if(typeof value==="string"&&value.match(regexIso8601)){input[key]=moment(value)}else if(typeof value==="object"){that.convertStringsToDates(value)}}};$BookSysUtil.String={};$BookSysUtil.String.addLeadingZero=function(str){return("0"+str).slice(-2)};